=== TOUR START: whitsunday Jet ski tours ===
Private Charters & Tours
whitsunday Jet ski tours
Discover the thrill of the Whitsundays with Ocean Dynamics, offering a variety of jet ski tour options from Airlie Beach. Our Whitsunday jet ski tours provide an exhilarating way to experience the region’s stunning beauty, crystal-clear waters, and diverse marine life. Perfect for adventure seekers, our tours promise an unforgettable journey through one of Australia’s most picturesque destinations.
Airlie beach jet ski tours
Airlie Adrenaline jet ski Tour
Price: $249 per jet ski (1 or 2 people)
A thrilling one-hour guided jet ski tour
Comprehensive safety briefing and all necessary equipment included
Private one-hour tours available from $1950 for a more exclusive experience
Full payment required at booking
Weight and height restrictions apply; minimum numbers required for tour operation
More than 48 hours: no fee
48-24 hours: 50% cancellation fee
24 hours or less (including no-show): 100% cancellation fee
Daydream island ultimate jet ski adventure
Price: $425 per single passenger jet ski, or $475 for 2 passengers
Exciting one-hour jet ski tour to Daydream Island
Full access to Daydream Island pools and facilities
Detailed safety briefing and all necessary equipment included
Departure from Airlie Beach at 8 am, returning by 5 pm
Minimum driver age 16, minimum passenger age 12
Not suitable for guests with mobility issues, neck or back problems, or pregnant women
Weight and height restrictions apply; minimum numbers required for the tour
Alcohol consumption on Daydream Island is limited; see full terms for details
© Copyright Ocean Dynamics
